The movie revolves around two friends (Sebastian and Angel) who suddenly discover their love for each other. They elope on the eve of the girl's marriage much to the chagrin of her brothers. The film essays their and the lovers' struggle for survival. The shooting of the film started on 15 May and was released on 7 June, 2013

